var g_current_data = {
  width: 20,
  height: 40,
  x: 14,
  y: 80,
  color: "blue",
  children: [{
    width: 10,
    x: 5,
    height: 10,
    y: 10,
    color: "purple",
    image: "data:image/jpeg;base64,",
  },
  {
    width: 10,
    x: 30,
    height: 10,
    y: 10,
    color: "black"
  }]
};

g_uid_registry = {};


// var $div = generate_element(20, 30, 20, 50);
